export const ItemDetailPage = () => {
  const { id, image } = useParams();

  return (
    <div>
      <h2>アイテム詳細ページ</h2>
      <p>選ばれたアイテムID: {id}</p>
      <p>{image}</p>
    </div>
  );
};
